const UserPage = ({user, onRollChange}) => {
const ser = JSON.stringify(user);
return(
    <div className="tc">
              <h1> User Page </h1>      
              {ser}   
    <p onClick={() => onRollChange("rollAgain")} className='f5 center link dib black pa3 pointer' > Roll Again?</p>

   </div>
    );
}

export default UserPage;
